INSERT INTO `respon_email` (`id`, `nim`, `nama`, `email`, `prodi`, `angkatan`, `kategori`, `survey`, `respon`, `created_at`, `updated_at`) VALUES
	(1, '1', 'ADMIN', 'natriumination@gmail.com', 'D3 Farmasi', '2017', 'Belum Bekerja', 'Apakah sudah pernah mengisi formulir tracer study?;Tempat, tangal lahir;Jenis kelamin;Nomor WhatsApp;Email;Alamat Lengkap;IPK setelah lulus;Tahun Masuk Kuliah di Universitas Borneo Lestari;Tahun Lulus (Berdasarkan Tanggal Wisuda);Semester Lulus (Berdasarkan tanggal Yudisium);	Berapa lama anda menunggu untuk mendapatkan pekerjaan setelah lulus? (dalam satuan bulan, terhitung setelah yudisium) *Indikator masa tunggu merupakan salah satu poin penilaian akreditasi. Jika saat mengisi kuesioner ini Anda belum mendapatkan pekerjaan maka dapat menuliskan tanda "-";Apakah anda bersedia untuk berbagi dengan almamater Universitas Borneo Lestari?;Jika bersedia, hal apa yang ingin anda bagikan untuk almamater Universitas Borneo Lestari (dapat lebih dari satu pilihan)?;Kepuasan alumni terhadap Dosen Program Studi/Fakultas ? Aspek yang dinilai antara lain keandalan dan kemampuan dosen dalam memberikan pelayanan terhadap mahasiswa, daya tanggap dosen dalam membantu mahasiswa dan memberikan jasa dengan cepat, kepastian bahwa pelayanan dosen sesuai dengan ketentuan, dan kepedulian dosen dalam memberi perhatian kepada mahasiswa (Keterangan skala : 1 = kurang, 2 = cukup, 3 = baik, 4 = sangat baik);Kepuasan alumni terhadap Tenaga Kependidikan? Aspek yang dinilai antara lain keandalan dan kemampuan tenaga kependidikan dalam memberikan pelayanan terhadap mahasiswa, daya tanggap tenaga kependidikan dalam membantu mahasiswa dan memberikan jasa dengan cepat, kepastian bahwa pelayanan tenaga kependidikan sesuai dengan ketentuan, dan kepedulian tenaga kependidikan dalam memberi perhatian kepada mahasiswa (Keterangan skala: 1 = kurang, 2 = cukup, 3 = baik, 4 = sangat baik);Kepuasan alumni terhadap Pengelola Program Studi ? Aspek yang dinilai antara lain keandalan dan kemampuan pengelola program studi dalam memberikan pelayanan terhadap mahasiswa, daya tanggap pengelola program studi dalam membantu mahasiswa dan memberikan jasa dengan cepat, kepastian bahwa pelayanan pengelola program studi sesuai dengan ketentuan, dan kepedulian tenaga kependidikan dalam memberi perhatian kepada mahasiswa (Keterangan skala: 1 = kurang, 2 = cukup, 3 = baik, 4 = sangat baik);Kepuasan alumni terhadap Sarana dan Prasarana Program Studi.  Aspek yang dinilai antara lain kecukupan, aksesibitas, kualitas sarana dan prasarana (Keterangan skala: 1 = kurang, 2 = cukup, 3 = baik, 4 = sangat baik);Kepuasan alumni terhadap Pengelolaan Keuangan selama Proses Pendidikan di Program Studi. Aspek yang dinilai adalah biaya yang dibebankan kepada alumni selama proses pendidikan dengan pelayanan yang didapatkan (Keterangan skala: 1 = kurang, 2 = cukup, 3 = baik, 4 = sangat baik);Saran untuk Program Studi/Fakultas/Universitas dilingkungan Universitas Borneo Lestari;Jika sampai saat ini anda belum bekerja;Faktor apa yang paling berperan dalam mendapatkan pekerjaan (dapat lebih dari satu)?;Berapa perusahaan/instansi/institusi yang sudah anda lamar (lewat surat atau e-mail) sebelum anda memeroleh pekerjaan pertama ? (tulis menggunakan angka);Berapa banyak perusahaan/instansi/institusi yang merespons lamaran anda ? (tulis menggunakan angka);Berapa banyak perusahaan/instansi/institusi yang mengundang anda untuk wawancara? (tulis menggunakan angka);Apakah anda aktif mencari pekerjaan dalam 4 minggu terakhir? Pilihlah satu jawaban;Nama Akun Media Sosial (aktif)', 'Pertama kali mengisi;halimun, 1 Januari 2000;Laki-laki;081234567890;natriumination@gmail.com;jl. kayu;3,59-4,00;Ganjil 2021/2022;2021;Genap;≤ 3 bulan;Tidak;Kerjasama penelitian;4;2;3;4;2;Menambah ruang kelas;TRTTK belum keluar;Kepribadian;3;2;2;Ya, tapi saya belum pasti akan bekerja dalam 2 minggu ke depan;@a', '2023-08-08 01:28:45', '2023-08-08 01:28:45'),
	(2, '1', 'ADMIN', 'natriumination@gmail.com', 'D3 Farmasi', '2017', 'Sudah Bekerja', 'Apakah sudah pernah mengisi formulir tracer study?;Tempat, tangal lahir;Jenis kelamin;Nomor WhatsApp;Email;Alamat Lengkap;IPK setelah lulus;Tahun Masuk Kuliah di Universitas Borneo Lestari;Tahun Lulus (Berdasarkan Tanggal Wisuda);Semester Lulus (Berdasarkan tanggal Yudisium);Apakah anda bersedia untuk berbagi dengan almamater Universitas Borneo Lestari?;Jika bersedia, hal apa yang ingin anda bagikan untuk almamater Universitas Borneo Lestari (dapat lebih dari satu pilihan)?;Kepuasan alumni terhadap Dosen Program Studi/Fakultas ? Aspek yang dinilai antara lain keandalan dan kemampuan dosen dalam memberikan pelayanan terhadap mahasiswa, daya tanggap dosen dalam membantu mahasiswa dan memberikan jasa dengan cepat, kepastian bahwa pelayanan dosen sesuai dengan ketentuan, dan kepedulian dosen dalam memberi perhatian kepada mahasiswa (Keterangan skala : 1 = kurang, 2 = cukup, 3 = baik, 4 = sangat baik) *;Kepuasan alumni terhadap Tenaga Kependidikan? Aspek yang dinilai antara lain keandalan dan kemampuan tenaga kependidikan dalam memberikan pelayanan terhadap mahasiswa, daya tanggap tenaga kependidikan dalam membantu mahasiswa dan memberikan jasa dengan cepat, kepastian bahwa pelayanan tenaga kependidikan sesuai dengan ketentuan, dan kepedulian tenaga kependidikan dalam memberi perhatian kepada mahasiswa (Keterangan skala: 1 = kurang, 2 = cukup, 3 = baik, 4 = sangat baik);Kepuasan alumni terhadap Pengelola Program Studi ? Aspek yang dinilai antara lain keandalan dan kemampuan pengelola program studi dalam memberikan pelayanan terhadap mahasiswa, daya tanggap pengelola program studi dalam membantu mahasiswa dan memberikan jasa dengan cepat, kepastian bahwa pelayanan pengelola program studi sesuai dengan ketentuan, dan kepedulian tenaga kependidikan dalam memberi perhatian kepada mahasiswa (Keterangan skala: 1 = kurang, 2 = cukup, 3 = baik, 4 = sangat baik);Kepuasan alumni terhadap Sarana dan Prasarana Program Studi.  Aspek yang dinilai antara lain kecukupan, aksesibitas, kualitas sarana dan prasarana (Keterangan skala: 1 = kurang, 2 = cukup, 3 = baik, 4 = sangat baik);Kepuasan alumni terhadap Pengelolaan Keuangan selama Proses Pendidikan di Program Studi. Aspek yang dinilai adalah biaya yang dibebankan kepada alumni selama proses pendidikan dengan pelayanan yang didapatkan (Keterangan skala: 1 = kurang, 2 = cukup, 3 = baik, 4 = sangat baik);Saran untuk Program Studi/Fakultas/Universitas dilingkungan Universitas Borneo Lestari;Jenis Pekerjaan/Instansi saat ini. Tuliskan Bidang perkerjaan saat ini termasuk bagian atau departemen jika bekerja pada suatu pemerintahan atau lembaga;Jenis Pekerjaan saat ini;Kapan anda mencari pekerjaan?;Nama institusi atau jenis usaha tempat anda bekerja;Jabatan pekerjaan;Apa status pekerjaan anda saat ini?;Lama periode pekerjaan saat ini;Apakah instansi tempat Anda bekerja saat ini merupakan pekerjaan pertama anda?;Nama atasan langsung Anda (beserta gelar). Tujuan pengumpulan data ini adalah untuk menghubungi atasan langsung guna mengisi tracer study untuk pengguna lulusan;Alamat email atasan Anda;Mohon sebutkan riwayat pekerjaan anda dan lama periodenya sebelum	pekerjaan yang saat ini (jika ada). Tuliskan jenis pekerjaan dan berapa lama anda bekerja;Apakah bidang pekerjaan anda relevan dengan bidang ilmu hasil pendidikan anda?;Dari mana anda mendapatkan informasi pekerjaan pertama?;Apakah pekerjaan anda saat ini memenuhi harapan anda (boleh memilih alasan lebih dari satu);Berapa take home pay (gaji+tunjangan+insentif+ dll) pertama anda dalam satu bulan?;Faktor apa yang paling berperan dalam mendapatkan pekerjaan (dapat lebih dari satu)?;Pernahkan anda pindah bekerja?;Apakah alasan anda pindah bekerja?;Nomor WhatsApp Pimpinan/Atasan;Alamat Lengkap Tempat anda bekerja (nama jalan, kelurahan, kecamatan, kabupaten dan provinsi);Apa tingkat tempat kerja Anda ?;Tingkat pendidikan apa yang paling tepat/sesuai untuk pekerjaan an