ana dan Prasarana Program Studi.  Aspek yang dinilai antara lain kecukupan, aksesibitas, kualitas sarana dan prasarana (Keterangan skala: 1 = kurang, 2 = cukup, 3 = baik, 4 = sangat baik);Kepuasan alumni terhadap Pengelolaan Keuangan selama Proses Pendidikan di Program Studi. Aspek yang dinilai adalah biaya yang dibebankan kepada alumni selama proses pendidikan dengan pelayanan yang didapatkan (Keterangan skala: 1 = kurang, 2 = cukup, 3 = baik, 4 = sangat baik);Saran untuk Program Studi/Fakultas/Universitas dilingkungan Universitas Borneo Lestari;Jenis Pekerjaan/Instansi saat ini. Tuliskan Bidang perkerjaan saat ini termasuk bagian atau departemen jika bekerja pada suatu pemerintahan atau lembaga;Jenis Pekerjaan saat ini;Kapan anda mencari pekerjaan?;Nama institusi atau jenis usaha tempat anda bekerja;Jabatan pekerjaan;Apa status pekerjaan anda saat ini?;Lama periode pekerjaan saat ini;Apakah instansi tempat Anda bekerja saat ini merupakan pekerjaan pertama anda?;Nama atasan langsung Anda (beserta gelar). Tujuan pengumpulan data ini adalah untuk menghubungi atasan langsung guna mengisi tracer study untuk pengguna lulusan;Alamat email atasan Anda;Mohon sebutkan riwayat pekerjaan anda dan lama periodenya sebelum	pekerjaan yang saat ini (jika ada). Tuliskan jenis pekerjaan dan berapa lama anda bekerja;Apakah bidang pekerjaan anda relevan dengan bidang ilmu hasil pendidikan anda?;Dari mana anda mendapatkan informasi pekerjaan pertama?;Apakah pekerjaan anda saat ini memenuhi harapan anda (boleh memilih alasan lebih dari satu);Berapa take home pay (gaji+tunjangan+insentif+ dll) pertama anda dalam satu bulan?;Faktor apa yang paling berperan dalam mendapatkan pekerjaan (dapat lebih dari satu)?;Pernahkan anda pindah bekerja?;Apakah alasan anda pindah bekerja?;Nomor WhatsApp Pimpinan/Atasan;Alamat Lengkap Tempat anda bekerja (nama jalan, kelurahan, kecamatan, kabupaten dan provinsi);Apa tingkat tempat kerja Anda ?;Tingkat pendidikan apa yang paling tepat/sesuai untuk pekerjaa