	(21, '21', 'Kapan anda memulai usaha ?', 'Sebelum lulus;Setelah lulus', '0', '0', '1', '2023-02-24 09:02:54', '2023-07-18 17:22:15'),
	(22, '22', 'Nama usaha tempat anda bekerja', '', '0', '0', '1', '2023-02-24 09:10:09', '2023-07-18 17:22:42'),
	(23, '23', 'Jabatan pekerjaan dalam usaha anda', '', '0', '0', '1', '2023-02-24 09:10:22', '2023-07-18 17:23:02'),
	(26, '26', 'Apakah tempat Anda bekerja saat ini merupakan pekerjaan/usaha pertama anda?', 'Ya;Tidak', '0', '0', '1', '2023-02-24 09:11:48', '2023-07-18 17:24:22'),
	(27, '27', 'Nama atasan langsung Anda (beserta gelar) atau pemilik usaha. Tujuan pengumpulan data ini adalah untuk menghubungi atasan langsung guna mengisi tracer study untuk pengguna lulusan', '', '0', '0', '1', '2023-02-24 09:12:36', '2023-07-18 17:25:33'),
	(28, '28', 'Alamat email atasan Anda', '', '0', '0', '1', '2023-02-24 09:13:41', '2023-02-24 09:13:41'),
	(29, '29', 'Mohon sebutkan riwayat pekerjaan anda dan lama periodenya sebelum	pekerjaan yang saat ini (jika ada). Tuliskan jenis pekerjaan dan berapa lama anda bekerja', '', '0', '0', '1', '2023-02-24 09:14:29', '2023-02-24 09:14:29'),
	(30, '30', 'Apakah bidang pekerjaan anda relevan dengan bidang ilmu hasil pendidikan anda?', 'Ya;Tidak', '0', '0', '1', '2023-02-24 09:14:53', '2023-02-24 09:14:53'),
	(31, '31', 'Dari mana anda mendapatkan informasi pekerjaan pertama?', 'Iklan/media massa;Program Studi Universitas Borneo Lestari;Relasi keluarga dan teman;Ikatan Alumni', '0', '1', '1', '2023-02-24 09:15:34', '2023-02-24 10:26:51'),
	(32, '32', 'Apakah pekerjaan anda saat ini memenuhi harapan anda (boleh memilih alasan lebih dari satu)', 'Ya, karena gaji sesuai;Ya, karena kedudukan/jabatan sesuai;Ya, karena iklim kerja menyenangkan;Tidak, karena gaji tidak sesuai;Tidak, karena kedudukan/jabatan sesuai;Tidak, karena iklim kerja tidak menyenangkan', '1', '1', '1', '2023-02-24 09:16:39', '2023-02-24 09:17:56'),
	(33, '33', 'Berapa take home pay (gaji+tunjangan+insentif+ dll) pertama anda dalam satu bulan?', 'Kurang dari Rp 2.000.000;Rp 2.000.000 – 5.000.000;Rp 5.000.000 – 10.000.000;Rp 10.000.000 – 15.000.000;Rp 15.000.000 – 25.000.000;Lebih dari Rp 25.000.000', '0', '0', '1', '2023-02-24 09:19:07', '2023-02-24 09:19:07'),
	(34, '34', 'Faktor apa yang paling berperan dalam mendapatkan pekerjaan (dapat lebih dari satu)?', 'IPK/kemampuan akademik;Asal perguruan tinggi;Kepribadian;Ekstra kurikuler: pengalaman organisasi, kelompok studi;Pengalaman lain: kursus keterampilan;Pengalaman lain: penguasaan bahasa asing', '1', '1', '1', '2023-02-24 09:20:37', '2023-02-24 09:20:37'),
	(35, '35', 'Pernahkan anda pindah bekerja?', 'belum pernah;1 kali;2 kali;> 2 kali', '0', '1', '1', '2023-02-24 09:21:24', '2023-02-24 09:21:24'),
	(36, '36', 'Apakah alasan anda pindah bekerja?', 'Perbaikan gaji;Kesesuaian dengan bidang ilmu;Manajemen instansi/Lembaga perusahaan;Peluang karir;Lingkungan pekerjaan tidak mendukung', '0', '1', '1', '2023-03-15 14:22:18', '2023-02-24 09:22:50'),
	(37, '37', 'Nama usaha Anda', '', '0', '0', '1', '2023-02-24 09:40:32', '2023-02-24 09:40:32'),
	(38, '38', 'Lama periode Anda berwirausaha', '', '0', '0', '1', '2023-02-24 09:40:47', '2023-02-24 09:40:47'),
	(39, '39', 'Bagaimana status kepemilikan perusahaan Anda saat ini?', 'Milik sendiri;Kemitraan', '0', '1', '1', '2023-02-24 09:41:19', '2023-02-24 09:41:19'),
	(40, '40', 'Jenis usaha apakah yang Anda lakukan saat ini?', 'Jasa;Dagang;Pabrik;Produksi', '0', '1', '1', '2023-02-24 09:42:04', '2023-02-24 09:42:04'),
	(41, '41', 'Motivasi apa yang mendorong Anda membuka usaha mandiri?', 'Meneruskan bisnis orang tua;Tidak suka bekerja dengan orang lain;Mencari tantangan;Mencari uang tambahan', '0', '1', '1', '2023-02-24 09:42:47', '2023-02-24 09:42:47'),
	(42, '42', 'Apakah bidang wirausaha anda relevan dengan bidang ilmu hasil pendidikan anda (kefarmasian)?', 'Ya;Tidak', '0', '0', '1', '2023-02-24 09:43:25', '2023-02-24 09:43:25'),
	(43, '43', 'Berapa penghasilan pertama anda dalam satu bulan?', 'Kurang dari Rp 2.000.000;Rp 2.000.000 – 5.000.000;Rp 5.000.000 – 10.000.000;Rp 10.000.000 – 15.000.000;Rp 15.000.000 – 25.000.000;Lebih dari Rp 25.000.000', '0', '0', '1', '2023-02-24 09:44:22', '2023-02-24 09:44:22'),
	(44, '44', 'Faktor apa yang paling berperan dalam berwirausaha? Jelaskan faktor yang berperan dalam anda berwirausaha', '', '0', '0', '1', '2023-02-24 09:44:40', '2023-02-24 09:44:40');
